import React, {Component} from 'react';
import api from '../services/api';

export class Projetos extends Component {
    constructor(props) {
        super(props);

        this.state = {
            links: []
        }

        this.getLastVideos();
    }

    getLastVideos = async () => {
        const config = {
            url: '/lastVideos',
            method: 'get'
          }
          await api.request(config)
            .then((response) => {
                if(response.status == 200){
                    console.log(response)
                    for(let i = 0; i < response.data.length; i++) {
                        const url = response.data[i].url;
                        console.log(url);
                        this.state.links.push(url);
                    }
                    console.log(this.state.links)
                }else{
                    console.error(response);
                    window.alert("Erro no status");    
                }
            })
            .catch((error) => {
                console.error(error);
                window.alert("Erro realizar request");
            })
    }
    
    render() {
        return (
            <div className='CorpoProjeto'>
            <div className="heading" id='ProjetoTitle'>
                <h2>Ultimos videos criados</h2>
            </div>

            <div className="row no-gutters">
                <div className="col-lg-1"></div>
                <div className="col-lg-4 item zoom-on-hover"><a href="/"><span className="description"></span></a>
                    <div className="video-container"><iframe title='sla' allowfullscreen="" frameborder="0" src="https://player.vimeo.com/video/201361986"></iframe></div>
                </div>
                <div className="col-lg-2"></div>
                <div className="col-lg-4 item zoom-on-hover">
                    <div className="video-container"><iframe title='sla2' allowfullscreen="" frameborder="0" src="https://player.vimeo.com/video/201361986"></iframe></div>
                </div>
                <div className="col-lg-1"></div>
            </div>
            <br></br>
            </div>
        )
    }
}

export default Projetos;
